import React, {useEffect,useState} from 'react';
import '../App.css';
import { Container,Button,Row,Col } from "react-bootstrap";
// import {Button} from '@material-ui/core'
import logo from '../assets/image/logo.png';
import {useHistory} from 'react-router-dom'

export default function Welcome(props){
    const history= useHistory();
    const handleChange=()=>{
        props.history.push('/AdminLogin')
    }

  const [java, setJava]= useState('');
  
  useEffect(()=>{
    fetch('http://localhost:8080/demo',{
      method: 'GET', 
    })
    .then((response) => response.json())
    .then((responseJson) => {
     setJava(responseJson)
    })
    // .then((java) => console.log('This is your data', java))
    .catch((error) => console.error(error))
    
  },[]);

 

    return(
        <div className="main">
        <Container fuild="xl" >
  <Row>
    <Col xl={12}><img src={logo} alt=" " className="mainLogo" /></Col>
    <Col xl={12}><h1 className="mainh1" >WELCOME TO</h1></Col>
    <Col><h4 className="mainh4" >DIGITAL IMMUNITY</h4></Col>
    <Col> <h6 className="mainh6" >PASSPORT</h6></Col> 
    <Col xl={12}>
    <Button className="startBtn" variant="outline-primary" onClick={handleChange} >{java}
    </Button>
    </Col>
  </Row>
</Container>
</div>
)}
